      SELECT DISTINCT - - cor0.col1 + tab0.col1 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab1

outputs:
